      "content": "<dd>\n<p>a directed acyclic graph with properties to provide a verifiable chain of <a class=\"term-reference\" href=\"#term:proof-of-authorship\">proof-of-authorship</a>. See the full <a path-0=\"trustoverip.github.io\" path-1=\"tswg-acdc-specification\" path-2=\"\" href=\"https://trustoverip.github.io/tswg-acdc-specification/\">specification</a></p>\n</dd>\n<dd>\n<p>Source: Dr. S.Smith, 2024</p>\n</dd>\n<dd>\n<p>Explained briefly, an ACDC or <a class=\"term-reference\" href=\"#term:authentic-data-container\">authentic-data-container</a> proves digital data consistency and authenticity in one go. An ACDC cryptographically secures commitment to the data contained, and its identifiers are self-addressing, which means they point to themselves and are also contained in the data.</p>\n</dd>\n<dd>\n<p>More in <a href=\"https://weboftrust.github.io/WOT-terms/docs/glossary/authentic-chained-data-container\">extended KERI glossary</a></p>\n</dd>"
