      "content": "<dd>\n<p>an <a class=\"term-reference\" href=\"#term:establishment-event\">establishment-event</a> that provides the incepting information needed to derive an AID and establish its initial Key state.</p>\n</dd>\n<dd>\n<p>Source <a path-0=\"github.com\" path-1=\"WebOfTrust\" path-2=\"ietf-keri\" path-3=\"blob\" path-4=\"main\" path-5=\"draft-ssmith-keri.md#basic-terminology\" href=\"https://github.com/WebOfTrust/ietf-keri/blob/main/draft-ssmith-keri.md#basic-terminology\">Sam Smith</a></p>\n</dd>\n<dd>\n<p>More in <a href=\"https://weboftrust.github.io/WOT-terms/docs/glossary/inception-event\">extended KERI glossary</a></p>\n</dd>"
